import Note from "./Note";

const Persons = ({ filteredPersons, persons }) => {
  if (filteredPersons.length > 0) {
    return (
      <div id="hello">
        {filteredPersons.map(person =>
          <Note key={person.id} name={person.name} phone={person.number} />
        )}
      </div>
    )
  }
  else {
    return (
      <div>
        {persons.map(person =>
          <Note key={person.id} name={person.name} phone={person.number} />
        )}
      </div>
    )
  }
}

export default Persons;
